/** @format */

import React, { Component } from "react";
import { Navbar, Nav } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react-router-dom";
import "./Navbar.css";

export default class NavbarComp extends Component {
  render() {
    return (
      <div>
        <Navbar bg='danger' variant={"dark"} expand='lg'>
          <Navbar.Brand href='#' id='nav-brand'>
            <span className='navbar-text text-light display-5'>KMS</span>
            <i>Power Solutions</i>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls='navbarScroll' />
          <Navbar.Collapse className='justify-content-end' id='navbarScroll'>
            <Nav
              className='mr-auto my-2 my-lg-0 justify-content-end'
              style={{ maxHeight: "80px" }}
              navbarScroll>
              <Nav.Link as={Link} to='/' className='NavLink'>
                Home
              </Nav.Link>
              <Nav.Link as={Link} to='/products' className='NavLink'>
                Products
              </Nav.Link>
              <Nav.Link as={Link} to='/about' className='NavLink'>
                About Us
              </Nav.Link>
              <Nav.Link as={Link} to='/contact' className='NavLink'>
                Contact Us
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    );
  }
}
